import DetailedPalette from './DetailedPalette';
import Modal from './Modal';
import { useState } from 'react';

function App() {

  const [showModal, setShowModal] = useState(true)

  return (
    <Modal showModal={showModal} setShowModal={setShowModal}>
        <DetailedPalette />
    </Modal>
  );
}

export default App;
